import "openzeppelin-solidity/contracts/token/ERC721/ERC721Mintable.sol";
import "openzeppelin-solidity/contracts/token/ERC721/ERC721MetadataMintable.sol";

/**
 * @title bs721
 UN not fungible token
 1) appartiene a un wallet (0x....)
 2) ha un nome (8126381762387168273)
 3)  unico, non ce ne sono 100, 1000, ma ce ne  solo 1
 Quindi contrariamente a Metacoin, nel nostro array (map) non sono quantit ma ci sono
 insiemi di nomi
    nft[address]  l'insieme degli nft (che sono in sostanza numeri associati a stringhe) appartenenti
    ad address!!!



    Elenco comandi da truffle:
let inst = await bs721.deployed() //Prende l'ultimo contratto pubblicato
let item= await inst.mint("0x56C55Af86ab04d05a99d70F51332f983836FbE9f", 1)  //crea NFT con id=1

per verifica:
inst.ownerOf(1)

 */
contract bs721 is ERC721Metadata, ERC721Enumerable, ERC721Mintable, ERC721MetadataMintable {
    address private _owner;    // current owner of the contract

    constructor (string memory name, string memory symbol) public ERC721Mintable() ERC721Metadata(name, symbol) {
        _owner = msg.sender;
    }

    function exists(uint256 tokenId) public view returns (bool) {
        return _exists(tokenId);
    }

    function addone(uint256 num) public view returns (uint256) {
        return num+1;
    }

    function tokensOfOwner(address owner) public view returns (uint256[] memory) {
        return _tokensOfOwner(owner);
    }

    function setTokenURI(uint256 tokenId, string memory uri) public {
        require(msg.sender == _owner, "Only the smart contract creator can change this attribute");
        // //Se volessi obbligare la setTokenUri solo per il "proprietario" dell'NFT, allora:
        // address proprietario = ownerOf(tokenId);
        // require(msg.sender == proprietario, "Only the token owner can change this attribute");

        _setTokenURI(tokenId, uri);
    }

    function transferFrom(address from, address to, uint256 tokenId) public {
        require(false, "You cannot transfer that token");
        // address owner = ownerOf(tokenId);
        // require(msg.sender == owner, "Only the token owner can change this attribute");

        // _transferFrom(from, to, tokenId);
    }

    function safeTransferFrom(address /*from*/, address /*to*/, uint256 /*tokenId*/, bytes memory /*_data*/) public {
        require(false, "You cannot transfer that token");
    }

    function approve(address /*_approved*/, uint256 /*_tokenId*/) public {
        require(false, "You cannot transfer that token");
    }
    function setApprovalForAll(address /*_operator*/, bool /*_approved*/) public {
        require(false, "You cannot transfer that token");
    }

    //Added 06122019: only the owner can burn
    function burn(uint256 tokenId) public {
        _burn(tokenId);
    }
}
